import React from "react";
import styled from "styled-components";

const HeaderContainer = styled.header`
background-color: greenyellow;
margin:15px;
padding: 16px;
height: 100px;
display: flex;
flex-direction: column;
`

const H1 = styled.h1`
display: inline;
`



const Header = () => {
   return (
       <HeaderContainer>

    

     <div>

         <button>
             Criar playlist
         </button>

         <button>
             Suas playlists
         </button>

     </div>


       </HeaderContainer>

   )
}

export default Header
